import React, { useState } from "react";
import styles from './App.module.css'

function App() {

  const images = [
    "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR-SvEJolIfuHTjEe3sBAVxfLmxF4Xv0IbjqQ&usqp=CAU",
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ34cJX2mS7C6ww8FoSDJ4uArR36zCNLV9Hvg&usqp=CAU',
    'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS5zS2P1YB1w5uYtT6Y5cFiHd9T12_LdLPktg&usqp=CAU',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT8-0QNV5Sv62CALuJz1A33-17bgRBG8Ucn5w&usqp=CAU'
  ];

  const [currentImage, setCurrentImage] = useState(0);

  const nextImage = () => {
    setCurrentImage(currentImage === 0 ? images.length - 1 : currentImage - 1)
  }

  const prevImage = () => {
    setCurrentImage(currentImage === images.length - 1 ? 0 : currentImage + 1);
  }
  
  return (
    <div className={styles.app}>
      <h1 className={styles.header} >The Strawhats</h1>
      <div className={styles.gallery}>
        <button onClick={nextImage} >◀</button>
        {images.map((image, index) => 
        currentImage === index && (
          <img src={images[currentImage]} key={image} alt="strawhats" />
        ))}
        <button onClick={prevImage} >▶</button>
      </div>
    </div>
  );
}

export default App;
